INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (0, 40000, 8, 0, 36, "", 1, 91002, 0, "", 100);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 40001, 8, 0, 37, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 1, 91002, 107501, "ぺコリーヌ", 150);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 40001, 8, 0, 38, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 2, 91002, 107601, "コッコロ", 150);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 40001, 8, 0, 39, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 3, 91002, 107801, "キャル", 150);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 40001, 8, 0, 40, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 4, 91002, 107701, "スズメ", 150);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 40001, 8, 0, 41, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 5, 91002, 107901, "タマキ", 150);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40001, 8, 0, 42, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 6, 91002, 107501, "ぺコリーヌ", 150);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40001, 8, 0, 43, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 7, 91002, 107601, "コッコロ", 150);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40001, 8, 0, 44, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 8, 91002, 107801, "キャル", 150);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40001, 8, 0, 45, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 9, 91002, 107701, "スズメ", 150);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40001, 8, 0, 46, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 10, 91002, 107901, "タマキ", 150);
