INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 40011, 2, 0, 321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 24001, 125801, "リリ", 1);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 40011, 2, 0, 322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 24001, 126001, "クリア", 1);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 40011, 2, 0, 323, "んーと。\nこれ、あげる。\nはい", 3, 24001, 126101, "プレシア", 1);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40011, 2, 0, 324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 4, 24001, 125801, "リリ", 1);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40011, 2, 0, 325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 5, 24001, 126001, "クリア", 1);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40011, 2, 0, 326, "お兄。\nきてくれて、うれしい", 6, 24001, 126101, "プレシア", 1);
